import React from 'react';

export default function Dashboard() {
    return (
        <>
        <div className="container">
            <div className="box_alerts">
                <div className="title">Alertas</div>
                <table>
                    <thead>
                        <th>Títutlo</th>
                        <th>Conteúdo</th>
                        <th>Data</th>
                        <th>Autor</th>
                    </thead>
                </table>
            </div>
        </div>
        </>
    );
}
